import './App.css'
import Calendar from './Components/Calendar';
import Deadline from './Components/Deadline';


function App() {

    return (
        <div className="App">
            <h1>My Timeline</h1>
            <div className='timeline'>
                <Calendar month={month} year={year}/>
                <Deadline/>
            </div>
        </div>
    );
}

export default App;
